apiVersion: v1
kind: Secret
metadata:
  name: infra-kubeconfig
  namespace: kubevirt-csi-driver
type: Opaque
stringData:
  kubeconfig: |
    apiVersion: v1
    clusters:
    - cluster:
        certificate-authority-data: 
        server: https://api.siircocpsb-base.reniec.gob.pe:6443
      name: siircocpsb-base
